import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Header from "./Header"; // ✅ 우리가 쓰는 헤더
import HamburgerMenu from "./HamburgerMenu";
import ValueIntro1 from "./assets/valueIntro1.png";
import ValueIntro2 from "./assets/valueIntro2.png";
import ValueIntro3 from "./assets/valueIntro3.png";// ✅ 이미지 import (경로 확인 필요)


function ValueIntro() {
  const navigate = useNavigate();
  const [step, setStep] = useState(0);
  const [menuOpen, setMenuOpen] = useState(false);

  const pages = [
    {
      image: ValueIntro1,
      content: (
        <>
          <div style={bubbleStyle}>
            <p><strong style={{ color: "#1292EE" }}>‘가치’란?</strong><br />
              우리가 세상, 타인, 그리고 자기 자신과<br />
              어떻게 관계 맺기를 원하는지를 향한<br />
              마음 깊은 바람입니다.
            </p>
          </div>
          <div style={connector}></div>
          <div style={bubbleStyleSecondary}>
            <p>
              가치는 우리 삶을 이끄는 <strong>원칙</strong>이자,<br />
              삶을 살아가는 데 동기를 부여해주는 <strong>방향성</strong>입니다.
            </p>
          </div>
        </>
      ),
      layout: "centered"
    },
    {
      image: ValueIntro2,
      content: (
        <p style={textStyle}>
          모든 사람이 똑같은 가치를 갖지 않아요.<br />
          밸류는 당신의 가치를 판단하지도 않아요.
        </p>
      ),
      layout: "top-center"
    },
    {
      image: ValueIntro3,
      content: (
        <p style={textStyle}>
          당신의 워크시트는 외부로 공개되지 않아요.<br />
          지금 당신의 가치를 찾아보세요.
        </p>
      ),
      layout: "top-center"
    }
  ];

  const current = pages[step];

  const handleNext = () => {
    if (step < pages.length - 1) {
      setStep(step + 1);
    } else {
      navigate("/survey");
    }
  };

  const skip = () => navigate("/survey");

  return (
    <div style={{ backgroundColor: "#f5f7f9", minHeight: "100vh", fontFamily: "sans-serif" }}>
      <Header title="내 삶의 방향 찾기" setMenuOpen={setMenuOpen} />
      <div
        style={{
          backgroundImage: `url(${current.image})`,
          backgroundSize: "cover",
          backgroundPosition: "center",
          height: "calc(100vh - 160px)",
          display: "flex",
          flexDirection: "column",
          justifyContent: current.layout === "centered" ? "center" : "flex-start",
          alignItems: "center",
          padding: current.layout === "centered" ? "2rem" : "6rem 2rem 2rem",
          textAlign: "center"
        }}
      >
        {current.content}
      </div>

      <div style={{ padding: "1.5rem", maxWidth: "500px", margin: "0 auto", display: "flex", justifyContent: step === 0 ? "space-between" : "center", gap: "1rem" }}>
        {step === 0 && (
          <button onClick={skip} style={whiteButton}>건너뛰기</button>
        )}
        <button onClick={handleNext} style={blueButton}>
          {step < 2 ? "다음으로" : "시작할게요"}
        </button>
      </div>

      <HamburgerMenu open={menuOpen} onClose={() => setMenuOpen(false)} navigate={navigate} />
    </div>
  );
}

const textStyle = {
  color: "#1292EE",
  fontWeight: "bold",
  fontSize: "1rem",
  textAlign: "center",
  lineHeight: "1.6"
};

const bubbleStyle = {
  backgroundColor: "#fff",
  border: "1px solid #1292EE",
  borderRadius: "20px",
  padding: "1rem",
  marginBottom: "1rem",
  fontSize: "0.95rem",
  color: "#333",
  lineHeight: "1.5",
  maxWidth: "90%"
};

const bubbleStyleSecondary = {
  backgroundColor: "#d9efff",
  borderRadius: "16px",
  padding: "1rem",
  fontSize: "0.95rem",
  color: "#333",
  lineHeight: "1.5",
  maxWidth: "90%"
};

const connector = {
  height: "16px",
  width: "2px",
  backgroundColor: "#1292EE",
  margin: "0 auto",
  marginBottom: "1rem"
};

const whiteButton = {
  flex: 1,
  padding: "0.9rem",
  borderRadius: "12px",
  backgroundColor: "white",
  color: "#1292EE",
  fontSize: "1rem",
  border: "1px solid #1292EE",
  fontWeight: "bold"
};

const blueButton = {
  flex: 1,
  padding: "0.9rem",
  borderRadius: "12px",
  backgroundColor: "#1292EE",
  color: "white",
  fontSize: "1rem",
  border: "none",
  fontWeight: "bold"
};

export default ValueIntro;
